import React from "react";
import { StyledPokeThumb } from "../styles/StyledPokeThumb";
import { Link } from "@reach/router";

const PokeThumb = ({ image, poke, clickable }) => (
  <StyledPokeThumb>
    {clickable ? (
      <Link to={`/${poke.id}`}>
        <div>
          <img
            className="clickable img_self"
            src={image}
            alt="moviethumb"
            loading="lazy"
          />
        </div>
      </Link>
    ) : (
      <img src={image} alt="pokethumb" />
    )}
  </StyledPokeThumb>
);

export default PokeThumb;
